// Blog.js
import React from 'react';
// import BlogEntry from './BlogEntry'; // Ensure correct path
import './Blog.css';


const Blog = () => {

  return (
    <div className="blog">
      {entries.map((entry, index) => (
        <BlogEntry
          key={index}
          title={entry.title}
          body={entry.body}
          image={entry.image}
        />
      ))}
    </div>
  );
};

export default Blog;
